    function acValAdd(val) {
        acAccA = $bm_sum(acAccA, val);
    }
    function upACoFx(prC) {
        ac.fade = 1;
        ac.intensity = 1;
        ac.en = true;
        ac.t = $bm_sub(t, bL.inPoint);
    }
    var ac = {
        'en': false,
        'fade': 0
    };
    var acI = {
        'en': false,
        'fade': 0
    };
    var acO = {
        'en': false,
        'fade': 0
    };
    ac.en = false;
    var v = thisProperty.value;
    var t = time;
    var acAccA = 0;
    (function () {
        upACoFx('2A4#3#1');
        if (ac.en) {
            ac.intensity = $bm_div(acSliderValP('AC FX [2A4] Controls', 'Intensity', 100), 100);
